          "id": "6e92b12faa020f12ef5e770282e7b2e854f4910c",
          "message": "fix(deps): update rust crate text-splitter to 0.16 (#267)\n\nThis PR contains the following updates:\r\n\r\n| Package | Type | Update | Change |\r\n|---|---|---|---|\r\n| [text-splitter](https://redirect.github.com/benbrandt/text-splitter) |\r\ndependencies | minor | `0.15` -> `0.16` |\r\n\r\n---\r\n\r\n### Release Notes\r\n\r\n<details>\r\n<summary>benbrandt/text-splitter (text-splitter)</summary>\r\n\r\n###\r\n[`v0.16.0`](https://redirect.github.com/benbrandt/text-splitter/blob/HEAD/CHANGELOG.md#v0160)\r\n\r\n[Compare\r\nSource](https://redirect.github.com/benbrandt/text-splitter/compare/v0.15.0...v0.16.0)\r\n\r\n##### Breaking Changes\r\n\r\n- Update to `v0.23.0` of `tree-sitter`. There was a breaking change for\r\nlanguage definitions, so this is also a breaking change for us,\r\nespecially on the Python side, since we support passing the language in.\r\n- Minim\u0010um Python version for the Python bindings is now 3.9 since 3.8\r\nwill be EOL next month.\r\n\r\n##### Python\r\n\r\nMake sure to upgrade to the latest version of your tree-sitter language\r\npackage.\r\n\r\n##### Rust\r\n\r\nMake sure to upgrade to the latest version of your tree-sitter language\r\npackage crate. These know have a `LANGUAGE` constant rather than a\r\n`language()` function.\r\n\r\n```rust\r\n// Before\r\ntree_sitter_rust::language()\r\n// After\r\ntree_sitter_rust::LANGUAGE\r\n```\r\n\r\n##### What's New\r\n\r\n- `MarkdownSplitter` can better parse the Commonmark HS extension for\r\nDefinition Lists.\r\n\r\n</details>\r\n\r\n---\r\n\r\n### Configuration\r\n\r\n📅 **Schedule**: Branch creation - At any time (no schedule defined),\r\nAutomerge - At any time (no schedule defined).\r\n\r\n🚦 **Automerge**: Disabled by config. Please merge this manually once you\r\nare satisfied.\r\n\r\n♻ **Rebasing**: Whenever PR becomes conflicted, or you tick the\r\nrebase/retry checkbox.\r\n\r\n🔕 **Ignore**: Close this PR and you won't be reminded about this update\r\nagain.\r\n\r\n---\r\n\r\n- [x] <!-- rebase-check -->If you want to rebase/retry this PR, check\r\nthis box\r\n\r\n---\r\n\r\nThis PR was generated by [Mend Renovate](https://mend.io/renovate/).\r\nView the [repository job\r\nlog](https://developer.mend.io/github/bosun-ai/swiftide).\r\n\r\n<!--renovate-debug:eyJjcmVhdGVkSW5WZXIiOiIzOC41OS4yIiwidXBkYXRlZEluVmVyIjoiMzguNTkuMiIsInRhcmdldEJyYW5jaCI6Im1hc3RlciIsImxhYmVscyI6W119-->\r\n\r\nCo-authored-by: renovate[bot] <29139614+renovate[bot]@users.noreply.github.com>",
