          "message": "fix(deps): update rust crate redis to v0.27.4 (#365)\n\nThis PR contains the following updates:\r\n\r\n| Package | Type | Update | Change |\r\n|---|---|---|---|\r\n| [redis](https://redirect.github.com/redis-rs/redis-rs) | dependencies\r\n| patch | `0.27.2` -> `0.27.4` |\r\n\r\n---\r\n\r\n### Release Notes\r\n\r\n<details>\r\n<summary>redis-rs/redis-rs (redis)</summary>\r\n\r\n###\r\n[`v0.27.4`](https://redirect.github.com/redis-rs/redis-rs/releases/tag/redis-0.27.4):\r\nredis v0.27.4\r\n\r\n[Compare\r\nSource](https://redirect.github.com/redis-rs/redis-rs/compare/redis-0.27.3...redis-0.27.4)\r\n\r\n##### Changes & Bug fixes\r\n\r\n- Add lastid option to xclaim\r\n([#&#8203;1360](https://redirect.github.com/redis-rs/redis-rs/pull/1360)\r\n[@&#8203;urkle](https://redirect.github.com/urkle))\r\n- Add xadd_options and xtrim_options\r\n([#&#8203;1361](https://redirect.github.com/redis-rs/redis-rs/pull/1361)\r\n[@&#8203;urkle](https://redirect.github.com/urkle))\r\n- Sync connection: Handle timed-out responses by ignoring them.\r\n([#&#8203;1290](https://redirect.github.com/redis-rs/redis-rs/pull/1290))\r\n- Expose the sink and stream parts of an async pubsub to the user.\r\n([#&#8203;1366](https://redirect.github.com/redis-rs/redis-rs/pull/1366))\r\n\r\n##### CI improvements\r\n\r\n- Add async iterator tests.\r\n([#&#8203;1364](https://redirect.github.com/redis-rs/redis-rs/pull/1364))\r\n\r\n###\r\n[`v0.27.3`](https://redirect.github.com/redis-rs/redis-rs/releases/tag/redis-0.27.3)\r\n\r\n[Compare\r\nSource](https://redirect.github.com/redis-rs/redis-rs/compare/redis-0.27.2...redis-0.27.3)\r\n\r\n##### Changes & Bug fixes\r\n\r\n- Add support for \\[TYPE type] in SCAN commands\r\n([#&#8203;1332](https://redirect.github.com/redis-rs/redis-rs/pull/1332)\r\n[@&#8203;Reiuji-ch](https://redirect.github.com/Reiuji-ch))\r\n- Align default timeouts on cluster client.\r\n([#&#8203;1333](https://redirect.github.com/redis-rs/redis-rs/pull/1333))\r\n- Updates unmaintained tokio-retry to tokio-retry2\r\n([#&#8203;1334](https://redirect.github.com/redis-rs/redis-rs/pull/1334)\r\n[@&#8203;naomijub](https://redirect.github.com/naomijub))\r\n- Align verification of protocol & TLS during cluster creation.\r\n([#&#8203;1289](https://redirect.github.com/redis-rs/redis-rs/pull/1289))\r\n- Include the StreamExt use statement in docs\r\n([#&#8203;1345](https://redirect.github.com/redis-rs/redis-rs/pull/1345)\r\n[@&#8203;joshrotenberg](https://redirect.github.com/joshrotenberg))\r\n- Further limit parser recursion\r\n([#&#8203;1346](https://redirect.github.com/redis-rs/redis-rs/pull/1346))\r\n\r\n##### CI improvements\r\n\r\n- Improve testing async-std\r\n([#&#8203;1314](https://redirect.github.com/redis-rs/redis-rs/pull/1314))\r\n- Test against Valkey in CI.\r\n([#&#8203;1315](https://redirect.github.com/redis-rs/redis-rs/pull/1315))\r\n- Add CI action to test whether feature combinations compile.\r\n([#&#8203;1328](https://redirect.github.com/redis-rs/redis-rs/pull/1328))\r\n\r\n</details>\r\n\r\n---\r\n\r\n### Configuration\r\n\r\n📅 **Schedule**: Branch creation - At any time (no schedule defined),\r\nAutomerge - At any time (no schedule defined).\r\n\r\n🚦 **Automerge**: Disabled by config. Please merge this manually once you\r\nare satisfied.\r\n\r\n♻ **Rebasing**: Whenever PR becomes conflicted, or you tick the\r\nrebase/retry checkbox.\r\n\r\n🔕 **Ignore**: Close this PR and you won't be reminded about this update\r\nagain.\r\n\r\n---\r\n\r\n- [ ] <!-- rebase-check -->If you want to rebase/retry this PR, check\r\nthis box\r\n\r\n---\r\n\r\nThis PR was generated by [Mend Renovate](https://mend.io/renovate/).\r\nView the [repository job\r\nlog](https://developer.mend.io/github/bosun-ai/swiftide).\r\n\r\n<!--renovate-debug:eyJjcmVhdGVkSW5WZXIiOiIzOC45Ny4wIiwidXBkYXRlZEluVmVyIjoiMzguMTE0LjAiLCJ0YXJnZXRCcmFuY2giOiJtYXN0ZXIiLCJsYWJlbHMiOltdfQ==-->\r\n\r\nCo-authored-by: renovate[bot] <29139614+renovate[bot]@users.noreply.github.com>"